// *************************** Capture image dimensions out of BMP**********

typedef struct obstacles {
	int exists;
	int hit;
	unsigned short deathbuffer;
	const unsigned short *bmpPtr;
	unsigned short xposition;
	int deathcount;
	int obvel;
} obstacle;

struct player{
	int frame; // counter
	int life; // health
	int speedcount;
	uint32_t score;
	unsigned short xpos, ypos; 
	unsigned short h, w;
	const unsigned short *runpt[5];
	const unsigned short *jpt;
};
typedef struct player PlayType;

PlayType Patt = {0, 100, 0, 0, 10 * FPConst, 115 * FPConst, 16, 24}; // our initial player

obstacle rocks[10];
unsigned int buttonPressed;
unsigned int doublePress;
unsigned int doubleFlag = 0;
unsigned int oldData = 0xFFFFF;
unsigned int closeRocks = 0;
void Game_End(void);
void GameInit(void) {
	ST7735_DrawBitmap(0, 127, start_screen, 160, 128);
	while(!buttonPressed);
	buttonPressed = 0;
	ST7735_FillScreen(0x0000);
	// init rocks array
	for(int i = 0; i < 10; i++) {
		rocks[i].exists = 0;
		rocks[i].bmpPtr = rock;
		rocks[i].obvel = 4 * FPConst;
		rocks[i].deathcount = 0;
	}
	// draw it
	for(int i = 0; i < 10; i++) {
		ST7735_DrawBitmap(i*16, 127, groundblock, 16, 12); 
	}
}

void Ports_Init(void) { volatile int delay;
	SYSCTL_RCGCGPIO_R |= 0x30; // turn on Port F
	delay = SYSCTL_RCGCGPIO_R;
	GPIO_PORTF_DEN_R |= 0x14; // enable PF4, PF2
	GPIO_PORTF_DIR_R &= ~0x10; // input PF0
	GPIO_PORTF_DIR_R |= 0x04; // output PF2
  GPIO_PORTF_AFSEL_R &= ~0x14; // clear AFSEL just in case
	GPIO_PORTF_PUR_R |= 0x10;
}

// Read in button input using Systick software interrupts
void SysTick_Handler() {
	unsigned long data;
	data = GPIO_PORTF_DATA_R & 0x10;
	if(!data && (oldData != data)) {
		if(buttonPressed && !doublePress)
			doublePress = 1;
		buttonPressed = 1;
	}
	oldData = data;
	SlideCheck();
}

void PlayerSprite_Init(void)
	{
		Patt.runpt[0] = mover1_br;
		Patt.runpt[1] = mover2_br;
		Patt.runpt[2] = mover3_br;
		Patt.runpt[3] = mover4_br;
		Patt.runpt[4] = mover5_br;
		Patt.jpt = moverjump_br;
	}
//randomly spawns rocks
void RockSpawn(int i)
{
	if(Random() == 200 && rocks[i].deathcount == 0){
		rocks[i].exists = 1;
		rocks[i].xposition = 160 * FPConst;
		rocks[i].hit = 0;
	for(int y = 0; y < 10; y++)
		{
			if(i != y && rocks[y].exists)
			{
					int32_t dif = rocks[i].xposition / FPConst - rocks[y].xposition / FPConst;
					if(((dif < 64) && (dif > 32)) || ((dif > -64) && (dif < -32)))
							rocks[i].exists = 0;
					else if(((dif <= 32) && (dif >= 16)) || ((dif >= -32) && (dif <= -16))){
						if(closeRocks <= 5)
							closeRocks++;
						else
							rocks[i].exists = 0;
					}
					else if(((dif < 16) && (dif >= 0)) || ((dif > -16) && (dif <= 0)))
						rocks[i].exists = 0;
					else
						closeRocks = 0;
			
		}
	}
}
}
