void Collide(void)
{
		for(int i = 0; i < 10; i++)
	  {
		  if(rocks[i].exists){
				if(!rocks[i].hit){
					if(intersecting((Patt.xpos+1 )/ FPConst, Patt.ypos / FPConst, Patt.h, Patt.w-2, (rocks[i].xposition+2) / FPConst, 127-12, 12, 14)){						
						GPIO_PORTF_DATA_R ^= 0x04;
						rocks[i].hit = 1;
						Array_Play(bump, 2367);
						Patt.life--;
						if(Patt.life == 0)
							Game_End();
					}
				}
		}
		}
}

void RockMove(void)
{
	for(int i = 0; i < 10; i++) {
			if(rocks[i].exists) {
				unsigned short oldx = rocks[i].xposition;
				rocks[i].xposition -= ADC;
				if(rocks[i].xposition / FPConst == 0 || rocks[i].xposition > oldx){
					rocks[i].xposition = 0;
					rocks[i].exists = 0;
					rocks[i].deathcount = 1;
				}
				ST7735_DrawBitmap(rocks[i].xposition / FPConst, 127-12, rocks[i].bmpPtr, 16, 16);
				
			}
			else if(rocks[i].deathcount)
			{
				rocks[i].deathbuffer += ADC;
				ST7735_DrawBitmap(rocks[i].xposition - (rocks[i].deathbuffer / FPConst), 127-12, rocks[i].bmpPtr, 16, 16);
				if(rocks[i].deathbuffer / 16 >= 10){
					rocks[i].deathbuffer = 0;
					rocks[i].deathcount = 0;
				}
			}
			else
				RockSpawn(i);
			
		  }
}
void SlideCheck(void)
{
	ADC = ADC_In() / 128;
}

void Game_End(void)
{
	ST7735_FillScreen(0x0000);
	ST7735_SetCursor(10, 7); //this should be changed
	ST7735_OutUDec(Patt.score); //this should be prettier
	while(1){};
}

 int main(void){
	unsigned int isJumping = 0;
	unsigned int isFalling = 0;
	unsigned int Grav = 0;
	//unsigned int jumpCounter = 0;
	int jumpPattern[14] = {5, 5, 4, 3, 3, 2, 2, -2, -2, -3, -3, -4, -5, -5};
  TExaS_Init();  // set system clock to 80 MHz
  Random_Init(1);
	ADC_Init();
  SysTick_Init();
	Ports_Init();
	Random_Init(NVIC_ST_CURRENT_R);
  Output_Init();
  ST7735_FillScreen(0x0000);            // set screen to black
	ST7735_SetRotation(1);
	Sound_Init(7256);
	GameInit();
	PlayerSprite_Init();
	EnableInterrupts();
	
	//PlayerSprite_Init();
  
	
	
	// Basic movement -- 1 frame = one unit, jumps are 2 units
	while(1) { // game loop
		// check for collisions
		Collide();
		//SlideCheck();
		// check button flag
		if(buttonPressed) {
			// check if jumping
			if(doublePress && !doubleFlag)
			{
				Array_Play(jump, 6506);
				isJumping = 1;
				doubleFlag = 1;
				Patt.frame = 0;
			}
			if(isJumping) {
				// adjust the jump frame by the amount in the array
				if(Patt.frame >= 6) { // is it the last index?
					isJumping = 0;
					isFalling = 1;
					Grav = 0;
					//buttonPressed = 0;
					Patt.ypos -= jumpPattern[Patt.frame] * FPConst;
				  ST7735_DrawBitmap(10, Patt.ypos / FPConst, Patt.jpt, 16, 27);
					Patt.frame = 0;
				}
				else{
				Patt.ypos -= jumpPattern[Patt.frame] * FPConst;
				ST7735_DrawBitmap(10, Patt.ypos / FPConst, Patt.jpt, 16, 27);
				Patt.frame++;
				}
			}
			else if(isFalling)
			{
				Patt.ypos += Grav;
				if((Patt.ypos / FPConst) > 115)
				{
					Patt.ypos = 115 * FPConst;
					ST7735_DrawBitmap(10, 115, Patt.jpt, 16, 27);
					isFalling = 0;
					buttonPressed = 0;
					Grav++;
					doubleFlag = 0;
					doublePress = 0;
				}
				ST7735_DrawBitmap(10, Patt.ypos / FPConst, Patt.jpt, 16, 27);
				if(Grav < (5 * FPConst))
					Grav = Grav + 1 * FPConst;
				else
					Grav = 5 * FPConst;
			}
			else {
				Array_Play(jump, 6506);
				isJumping = 1;
				Patt.ypos = 115 * FPConst; //make sure these are 0
				Patt.frame = 0;
				ST7735_DrawBitmap(10, Patt.ypos / FPConst, moverjump_br, 16, 24);
			}
		} else {
				 ST7735_DrawBitmap(10, 127-12, (Patt.runpt[Patt.frame]), 16, 24);
				 //Patt.frame = (Patt.frame + 1) % 5;
				 if(Patt.speedcount / FPConst >= 3){
					 Patt.frame = (Patt.frame + 1) % 5;
					 Patt.speedcount = 0;
				 }
				 else
					 Patt.speedcount += ADC;
			}

		// move rocks
		RockMove();
		//output score	
		ST7735_SetCursor(0, 0);
		Patt.score += ((ADC) / FPConst);
		LCD_OutDec(Patt.score);
		//ST7735_SetCursor(80, 40);
		//ST7735_OutUDec(ADC);
		Delay100ms(1);
	}
}


// You can use this timer only if you learn how it works

void Delay100ms(uint32_t count){uint32_t volatile time;
  while(count>0){
    time = 200000;  // 0.1sec at 80 MHz
    while(time){
	  	time--;
    }
    count--;
  }
}


